var want_image_count = 0;
var loadGameImage = function (n) {
 want_image_count++;
 var o = document.createElement('img');
 o.onload = function () {
  want_image_count--;
  if ((want_image_count == 0) && (want_sound_count == 0)) {
   gameLoaded();
  }
 }
 o.src = n;
 return o;
}

//var sounds_playing = [];
var want_sound_count = 0;
var loadGameSound = function (n, chc) { // file name, channel count
 var o = {};
 
 o.channels = [];
 o.channel_pos = 0;
 o.chc = chc;
 
 o.play = function () {
  if (!sndo.has_sound) {
   return;
  }
  var tm = new Date().getTime();
  var sc = this.channels.length;
  var got_good_sound = false;
  var ch;
  for (var i = sc; i>=0; i--) {
   this.channel_pos++;
   if (this.channel_pos >= this.channels.length) {
    this.channel_pos = 0;
   }
   var ch = this.channels[this.channel_pos];
   got_good_sound = true;
   break;
  }
  if (ch && ch.sound && got_good_sound) {
   ch.sound.play();
  }
 }
 
 for (var i = 0; i<chc; i++) {
  var ao = document.createElement("audio");
  var sch = {};
  sch.sound = ao;
  sch.can_play = true;
  o.channels.push(sch);
  ao.src = n;
  if (ao.src == 'https://cdn.glitch.global/b871a81a-c654-41e2-b425-e45e45f3219f/explosion-42132.mp3?v=1733508361323') {
    ao.volume = 0.2
  }
  ao.type = "audio/wav";
  document.body.appendChild(ao);
 }
 return o;
}

